// 2. Add a new Component called Unit to display a unit

import { useState } from "react";

const UnitDelete = (event) => {
    event.preventDefault();
    const unitObject = {
        id: units[units.length - 1].id + 1,
        code: newUnitCode,
        title: newUnitTitle,
        offering: "S1",
    };
    console.log("unitObject", unitObject);
    axios.post("http://localhost:3001/units", unitObject).then((response) => {
        console.log("Post response" + response.data);
        setUnits(units.concat(unitObject));
        setNewUnitCode("");
        setNewUnitTitle("");
        console.log("New unit added");
        console.log("unitObject", unitObject);
    });
};

const Unit = (props) => {
    return (
        <div className="unit">
            <h2>
                {props.code} {props.title}
            </h2>
            <button type="submit" onClick={UnitDelete}>
                Delete
            </button>
        </div>
    );
};

export default Unit;
